                        "Desc": "Властью над «борьбой» призывает Всеогненное вооружение, передаваемое из поколения в поколение людей-Архонтов, и наносит <color style='color:#FF9999;'>Пиро урон</color> с характеристикой Ночного духа.<br>После применения Мавуика восстанавливает очки Ночного духа до максимума и переходит в состояние Благословения Ночного духа.<br><br><color style='color:#FFD780;'>Всеогненное вооружение</color><br>При долгом нажатии его форма меняется.<br><br><color style='color:#FFD780;'>Быстрое нажатие</color><br>Высвобождение имени божества: Всеогненное вооружение проявляется в форме Колец испепеляющего блеска. Кольца испепеляющего блеска следуют за активным персонажем и периодически атакуют врагов поблизости, нанося <color style='color:#FF9999;'>Пиро урон</color> с характеристикой Ночного духа.<br><br><color style='color:#FFD780;'>Долгое нажатие</color><br>Высвобождение древнего имени: Всеогненное вооружение проявляется в форме пламецикла. В этом состоянии Мавуика может ездить на пламецикле на высокой скорости или активировать его скрытый резервный силовой модуль, чтобы кратковременно преодолевать различные типы местности и некоторое время парить в воздухе. При этом урон обычных атак, заряженных атак и атак в падении Мавуики конвертируется в <color style='color:#FF9999;'>Пиро урон </color> с характеристикой Ночного духа, который не может быть отменён другими инфузиями. Во время спринта она также наносит врагам на своём пути <color style='color:#FF9999;'>Пиро урон</color> с характеристикой Ночного духа.<br><br>Когда Мавуика пребывает в состоянии Благословения Ночного духа, быстрым нажатием элементального навыка можно изменить форму Всеогненного вооружения. Всеогненное вооружение исчезнет, когда прекратится состояние Благословения Ночного духа Мавуики.<br><br><color style='color:#FFD780;'>Благословение Ночного духа: Мавуика</color><br>Непрерывно расходует очки Ночного духа согласно форме Всеогненного вооружения. Когда очки Ночного духа исчерпаются, Благословение Ночного духа Мавуики завершается.<br><br><i>Если вы скажете Мавуике, что в другом мире транспортному средству вроде её пламецикла нужен номерной знак, она обрадуется и этому:<br>«Моё в этом мире единственное в своём роде. Стало быть, мне и выбирать номер?»</i>",
