                        "Name": "Час пылающих небес",
                        "Desc": "Пусть голоса людских сердец донесутся до божественного трона в небесах.<br><color style='color:#FFD780;'>Взрыв стихии Мавуики зависит не от энергии, а от Боевого духа.</color><br><br><color style='color:#FFD780;'>Боевой дух</color><br>Когда у Мавуики не менее 50% Боевого духа, она может полностью потратить его и выпустить взрыв стихии.<br>Мавуика может получать Боевой дух следующими способами:<br> ·  В бою очки Ночного духа, расходуемые членами отряда поблизости, конвертируются в Боевой дух Мавуики.<br> ·  Обычные атаки членов отряда поблизости, поражая противников, дают Мавуике 1,5 ед. Боевого духа. Этот эффект может возникнуть один раз в 0,1 сек.<br><br>После применения навыка Мавуика получает 10 очков Ночного духа и входит в состояние Благословения Ночного духа. Летя на пламецикле высоко в воздухе, она однократно атакует врагов на земле могущественным Ударом падающего солнца, который наносит <color style='color:#FF9999;'>Пиро урон по площади</color> с характеристикой Ночного духа, и входит в состояние Горнила смерти и жизни.<br><br><color style='color:#FFD780;'>Горнило смерти и жизни</color><br>Во время его действия различные действия Мавуики не расходуют очки Ночного духа, а её сопротивление прерыванию повышается. Кроме того, повышается урон Удара падающего солнца, а также обычной и заряженной атаки Высвобождения древнего имени, пропорционально количеству Боевого духа на момент активации взрыва стихии.<br>Горнило смерти и жизни исчезает, когда Мавуика покидает поле боя.<br><br><i>«...Но на сей раз я собственными руками разобью такую судьбу».</i>",
